import  './components.css' ;

    export default function Table(){
        return(
            <div className="container-fluid p-5 mt-3" >
                <table className="table-info-responsive "> 
                    <thead>    
                            <th scope="col">id</th>
                            <th scope="col">nombre</th>
                            <th scope="col">telefono celular</th>
                        </thead>                   
                    </table>
            </div>
        );

    }
